import React from "react";

export const UserMessage = () => {
  return (
    <div className="user-message">
      Dear Customer,
      <br /> Welcome to the new login page of HDFC Bank NetBanking.
      <br /> Its lighter look and feel is designed to give you the best possible
      user experience. Please continue to login using your customer ID and
      password.
    </div>
  );
};
